    return(
        <>
        <div className="icon">

        </div>
        <div className="content">
            <h5>{title}</h5>
            <div className="innercontent">
            <div className="text">
              {amount} 
            </div>
                <div className="del-btn">
                  {deleteItem}
                </div>
            </div>
        </div>
       
        </>
    )
}
